function migratoryBirds(arr) {
  // Write your code here
  let birds;
  const setBirds = new Set(arr);
  let iteration = 0;

  for (const birdIndex of setBirds.values()) {
    const currrentTotalBirds = arr.filter(
      (value) => value === birdIndex
    ).length;
    if (iteration === 0) {
      birds = [birdIndex, currrentTotalBirds];
    } else if (birds[1] < currrentTotalBirds) {
      birds = [birdIndex, currrentTotalBirds];
    } else if (birds[1] === currrentTotalBirds) {
      if (birds[0] >= birdIndex) {
        birds = [birdIndex, currrentTotalBirds];
      }
    }

    iteration++;
  }

  return birds[0];
}

